import styles from '../styles/scss/dashboard.module.scss';
import classnames from 'classnames';
import { useSelector, useDispatch } from 'react-redux';
import { setProfileImage } from '../components/actions/profileImageActions';
import DashboardMenu from '../components/DashboardMenu';

const Dashboard = () => {
	return (
		<main className={styles.dashboardContainer}>
			<div className={styles.dashboardMenuContainer}>
				<DashboardMenu />
			</div>
		</main>
	);
};

export async function getStaticProps() {
	const profileImage = 'https://i.imgur.com/0byOhwQ.jpg';
	useDispatch(setProfileImage(profileImage));
}

export default Dashboard;
